import react from 'react';
import SpringApiUrl from '../services/UserServiceApi';
import SpringApiDocsListUrl from '../services/DoctorsList';
import SpringPatientsListApiUrl from '../services/PatientsList';
import './Tumor.css';
//import axios from 'axios';
import DatePicker from 'react-datetime';
import moment from 'moment-timezone';
import 'react-datetime/css/react-datetime.css';
import { Multiselect } from 'multiselect-react-dropdown';
import Select from "react-select";
import ReactSearchBox from 'react-search-box';
import Patient from '../Componentspatient/Patientinterface';
//import Doctor from './ComponentsDoctor/DoctorInterface';
import { BrowserRouter as Router, Switch, Route, Link } from "react-router-dom";


//https://stackoverflow.com/questions/56017457/react-select-multi-select-check-box-with-select-all
// <--input name="patient_id_fk" type="text" id="patient_id_fk" value={this.state.patient_id_fk} onChange={this.handleInputChange} onKeyPress={this.onKeyUp} /-->


class Tumorboard extends react.Component {


    // const [dt, setDt] = useState(moment());

    

    render() {


       

        return (
            <div>
               <Router>
        <div id="header">
          <div id="sub_header">
            <div id="header_sec_1">

            </div>
            <div id="header_sec_2">
              <div id="header_buttons">
                <Link to="/tumorboardinterface"><button id="tumorboard">Tumorboard</button></Link>
                <Link to="/patient"><button id="patients">Patients</button></Link>
              </div>
            </div>
            <div id="header_sec_3">
              <i className="fas fa-user" />
            </div>
          </div>
        </div>

        <Route path="/tumorboardinterface" component={Tumorboard}></Route>
        <Route path="/patient" component={Patient}></Route>
        <Route path="/doctor" component={Doctor}></Route>
      </Router>

                
            </div>
        )
    }

}


export default Tumorboard;
